const SugarDetails = ({ sugar }) => {
  return (
    <div className="workout-details">
      <h4>{sugar.sugarlvl}</h4>
      <p>{sugar.meal}</p>
      <h4>{sugar.time}</h4>
      <p>{sugar.notes}</p>
    </div>
  );
};
export default SugarDetails;
